(()=>{const e=e=>{e.preventDefault();const o=e.currentTarget.closest(".panel-block"),l=o.closest(".panel").querySelectorAll(".panel-block.is-hidden");for(const e of l)e.classList.remove("is-hidden");o.remove()},o=document.querySelectorAll(".is-show-all-button");for(const l of o)l.addEventListener("click",e)})();